const Hero = () => {
	return (
		<div className="hero min-h-min bg-base-200 shadow-md">
			<div className="hero-content flex-col lg:flex-row-reverse">
				<img src="./img/hero-image.png" className="max-w-sm translate-y-4" />
				<div>
					<h1 className="text-5xl font-bold sm:mt-4">Moh. Aulia Miftakhurahmat</h1>
					<p className="py-6">Halo, Seorang mahasiswa Teknik Informatika yang bercita-cita menjadi web developer</p>
					<button className="btn btn-primary">Get Started</button>
				</div>
			</div>
		</div>
	)
}

export default Hero;
